  false,\n\t\"url\": null,\n\t\"notes\": \"This project is a cooperative effort between
  the National Ocean Service, National Centers for Coastal Ocean Science, Center for
  Coastal Monitoring and Assessment, the University of Hawaii, and Analytical Laboratories
  of Hawaii, LLC. The goal of the work was to map the coral reef habitats of Palau
  by visual interpretation and manual delineation of IKONOS satellite imagery. A two
  tiered habitat classification system was used in this work. The scheme integrates
  geomorphologic reef structure and biological cover into a single scheme and subsets
  each into detail. It also includes thirteen zones.\",\n\t\"license_title\": null,\n\t\"extras\":
